import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import dog from '../media/dog.jpeg'
import cat from '../media/cat.jpeg'

const Home = () => {
    return (
        <Container>
            <Row>
                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" height={400} src={cat} />
                    <Card.Body>
                        <Button variant="primary">Взять кошку</Button>
                    </Card.Body>
                </Card>

                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" height={400} src={dog} />
                    <Card.Body>
                        <Button variant="primary">Взять собаку</Button>
                    </Card.Body>
                </Card>
            </Row>
            <Row>
                <Col>
                <Button variant="primary" className='mt-3'>Отдать питомца</Button>
                </Col>
                <Col>
                <Button variant="primary" className='mt-3'>Помочь приюту</Button>
                </Col>
            </Row>
        </Container>
    );
};

export default Home;
